INSERT INTO `5kcrm_oa_event` VALUES (1,'联系客户',1565920800,1566007199,32,1565879967,1565879967,0,0,'','',''),(2,'拜访康立泰药业有限公司',1566363600,1566372600,11,1566399225,1566399225,0,0,'','研发企业，单机版，一直有自己做的想法，但是一直没有开展，也有DMS的需求。','#3E8EF7'),(3,'拜访山东鲁银药业有限公司',1566451800,1566462600,11,1566612802,1566612802,0,0,'','单机版，实验室都是岛津的设备，介绍DBS系统。','#3E8EF7'),(4,'参加济南培训班',1566518400,1566640860,11,1566612452,1566612452,0,0,'','','#3E8EF7'),(5,'拜访科兴生物化学原料厂',1566280800,1566291600,11,1566612733,1566612733,0,0,'','和菅立军老师一同拜访，意向产品CSV。','#3E8EF7'),(6,'拜访山东新华鲁抗医药公司',1566190800,1566201600,11,1566612706,1566612706,0,0,'','和菅立军老师一同拜访，意向产品CSV。','#3E8EF7'),(9,'在公司联系客户',1566781200,1567155600,11,1566867592,1566867592,0,0,'','联系客户+学习DMS/DAS演练！','#3E8EF7'),(10,'苏州培训班出差',1566259200,1566599400,13,1566805241,1566805241,0,0,',13,','苏州计算化系统验证培训班，会上跟踪了两家意向客户，江苏无锡知原药业有限公司，有软件的需求，江苏小林制药有限公司，金蝶k3系统，能否做位物料管理系统，需要提供计算化系统验证，以及咨询业务，后续跟进。','#3E8EF7'),(11,'苏州计算机化系统验证培训班出差',1566259200,1566597600,13,1566805485,1566805485,0,0,',1,2,35,',' 苏州计算化系统验证培训班，会上跟踪了两家意向客户，江苏无锡知原药业有限公司，有软件的需求，江苏小林制药有限公司，金蝶k3系统，能否做为物料管理系统，需要提供计算化系统验证，以及咨询业务，后续跟进。','#3E8EF7'),(12,'送中秋礼品给黄三妹，约明天上午十点去厂里见面',1567008000,1567094399,12,1566963157,1566963157,0,0,'','',''),(13,'DMS/DAS操作培训与演练',1566954030,1566979969,11,1566982923,1566982923,0,0,',13,','今天张薪新和何志强一同让王学勤老师讲解了一下DMS与DAS的操作，并实际讲解与操作DMS与DAS系统。也下载了远程软件，以后便于远程操作。','#3E8EF7'),(14,'跟进客户，查看项目计划书',1566979379,1566986400,11,1566983283,1566983283,0,0,'','张碧兰已经为企业拟定了CSV的项目计划书，和企业王老师简单的沟通，等下班后抽时间再和王老师无障碍的交心，透漏一下利益分配。','#3E8EF7'),(15,'目前没有把CSV计划在日程内，一是觉得不是十分的重要，二是预算也不是很宽裕，三是也比较忙。我说明了一下，CSV这个事，是法规明确要求的，其实早晚都得做，就是早做还是晚做，咱们自己主动做了，和检查后强制要求做的区别，那么晚做不如早做。问了一下她年底能不能有这方面的计划，她回答不一定，可能会有，也可能明年再考虑。最后让随时保持联系，有咨询或者软件方面的问题都可以随时联系我。',1569340800,1569427199,11,1567046464,1567046464,0,0,'','',''),(16,'单机版，之前考虑过做CSV，后来搁浅了。问了一下搁浅的原因，之前是考虑扩充业务所以想做CSV，后来觉得现在工作量都已经饱和了，所以就不准备开展其它业务了。网络版还没有考虑。已经加了微信，可以定期的联系一下，有其它想做的业务联系也比较方便 。',1569427200,1569513599,11,1567068561,1567068561,0,0,'','',''),(17,'向何总汇报工作情况',1567128540,1567133236,11,1567135531,1567135531,0,0,',2,','何总问了一下益康回款的情况，然后又问了上周拜访客户的情况，也帮我分析了客户。以及后期拜访客户应该注意的事项。做事情要有规划有总结。','#3E8EF7'),(18,'沟通益康第三笔款项问题',1567145340,1567152569,11,1567152644,1567152644,0,0,',2,4,','张薪新、何总与王老师邮件沟通益康第三笔款项问题。','#3E8EF7'),(19,'吉林出差',1567382400,1567728000,14,1567340031,1567340031,0,0,'','出差','#3E8EF7'),(20,'益康第三笔款项的问题',1567386053,1567411200,11,1567417937,1567417937,0,0,',1,2,4,','上午和客户沟通，并且把客户沟通内容以及自己的想法发邮件给何总和王老师，下午向何总，王老师和竭老师汇报了具体情况，领导也帮我分析了原因，王老师建议我和两位技术老师交流一下，看看是否存在其它问题，包括项目上的情况。下午也和两个技术老师进行了语音会议，按照合同能提供给客户的文件都已经提供了。晚上再近一步和满总聊聊，看看是否有其它方面的顾虑，包括公关费用，也请满总放心，承诺的一定会做到，这笔款项支付后就申请一部分费用，等到尾款支付完成，再申请最后一笔费用，其它的顾虑也帮助满总解除一下，最后就是麻烦满总关于第三笔款项的事，费费心，因为确实时间太长了，我向公司也不好交待的话！','#3E8EF7'),(21,'联系9月6日进药厂见面，送月饼',1567699200,1567785599,12,1567418609,1567418609,0,0,'','',''),(22,'在公司联系客户',1567472608,1567503180,11,1567501474,1567501474,0,0,'','在公司联系客户。','#3E8EF7'),(23,'在公司联系客户',1567555200,1567589820,11,1567644883,1567644883,0,0,'','','#3E8EF7');
