INSERT INTO `5kcrm_oa_log` VALUES (1,2,'','本周拜访了四家企业，其中康立泰明确指出9月或10月份开始实施CSV工作。想让第三方给做一台难度较高的CSV，其它设备自己做。科兴化学原料药厂想等总部做了以后再实施。','跟进上周拜访的企业，着重联系一下科兴总部。再电话联系新客户。','在联系DBS的过程当中，客户会问都有哪些企业做过DBS系统，还有DBS单价看着性价比很高，但是几十台设备需要增加的端口费用太高。',11,1566615413,1566615413,',1,2,35,','',',11,1,35,2,'),(2,1,'','胡朝洋：已查看你的客户追踪，大部分是向客户询问CSV是否做了，公司产品较多，询问策略可有所改变，对于客户网络版的可以着重推荐CSV，单机版用户可询问客户备份策略？是用移动硬盘手动备份还是有自动备份的系统，我们可提供客户自动备份的解决方案，目前是针对单机客户端较多的用户比较好的产品。','尽量多了解客户的需求，然后根据客户的需求给客户出解决方案！','',1,1566741286,1566741286,',2,4,5,8,9,','',',1,8,9,2,35,'),(3,1,'','学习演练dms数据管理系统，das偏差识别系统演练','','',13,1566984905,1566984905,'','',',13,1,35,2,'),(4,2,'','本周的工作内容，跟进老客户+联系新客户+DMS/DAS实际操作演练。其中为康立泰药业有限公司拟定了项目计划书。沟通益康第三笔款项问题。','和益康具体落实第三笔款项，在公司联系客户。','哪些客户需要拜访的准确度拿捏不好。我原来是做本地销售，人在北京，客户也在北京，当时是联系上客户就预约拜访，建立初步联系。之前的企业也是对于拜访有要求，鼓励多拜访。我不确定咱们的客户如果没有做过相关项目，比如说客户目前是单机版，我们可以推网络版或者数据自动备份包括验证，但是客户还没有明确的需求时，我们是否就可以预约拜访，还是等到客户想做了有预算时我们再进行拜访，就是这个拜访的度总是掌握不好，因为毕竟差旅费也是公司投资在我们身上比较大的支出。',11,1567152499,1567152499,',1,2,35,','',',11,1,2,35,'),(5,2,'','本周和潘二宝老师出差，详细内容如下：\n8月26日，安徽华威药业，无菌滴眼剂的审计，预计明年六月份审计。合作方式：一次无菌审计，以及辅导其建立无菌管理及验证等。\n8月27日，江西博雅欣和，此公司报上去的一致性品种，因石药欧意做了BE，所以打算放弃掉。\n                 江西亿友药业，一致性评价的审计，合同已经发过去了，价格3.8万，不含差旅。\n8月28日，岳阳新华达药业，一致性评价审计需要上报老板同意，报价六万，目前来看还是比较有意向的，网络版软件没有验证。\n8月29日，植物药业，一致性评价品种是5月报上去的，意向不是很强烈。\n                中国医学院生物学研究所，沟通了一下计算机化系统验证。\n8月30日，维和药业，会员制的一致性评价审计，主审内容是：实验室审计。\n8月31日，大理药业，送感谢费，并沟通了今年的情况，预计后续要做审计和质量体系完善。','下周的工作安排主要是对上周拜访的客户和签订的合同进行落实，并且对之前苏州班的意向客户进行对接。详细如下：\n 一、江西亿友药业的合同签订流程。\n 二、华威、博雅，新华达等企业意向继续对接。\n三、南阳新生制药的辅料变更和口服液增加规格进行对接。\n四、苏州班沟通的意向客户更近。','',8,1567324667,1567324667,'','',',8,2,1,'),(6,2,'','8月21-24日太原出差总结\n1.本次出差是去推进山西鑫煜药业的一致性评价工作进度，目前企业的水系统改造已经完成，实验室搬迁也已经完成，目前菅立军老师已经驻场服务，接了来CSV的合同还要继续增加几台，具体的等到实验室的老师驻场后，根据工作进度看。\n2.跟鑫煜的刘总沟通关于技术老师的差旅费报销的问题，目前已经解决。\n3.去山西宝泰药业有限公司拜访，他们目前的进度是原料药刚过完认证，GMP证书还没有拿到，山东创新那边的原料药研究还未开始，合同已签，还未付款。待原料药GMP证书到手，先生产，把资金盘活，启动山东创新的项目，等到山东创新的原料药研究透彻后，才会开始我们的一致性评价工作。\n4.山西宝泰药业的张立斌准备离职，做了6年的QC，6年的QA，2015年来的山西宝泰，消息我已经告诉王老师，王老师的意思是过段时间看是否可以招募。\n5.参加太原的培训班与山西云鹏药业的质量经理苏蓉沟通他们单位的一致性评价审计的事情。\n6.与晋阳制药厂沟通中秋后的DMS现场交流的时间，及现场的软件介绍。','下周工作安排\n1.与舒兰合成敲定FDA回复与体系建设合同细节，需要去一趟舒兰。已抢到9月3号的火车票\n2.与洮南敖东明确合同细节，具体看是否需要去白城。\n3.舒兰结束后去拜访吉林长源制药李总，他们需要采购一套DMS.\n4.看具体时间还需要找一下长春万通苑总，圣金诺张总，吃个晚饭。','无',14,1567391582,1567391582,',1,2,','',',1,35,2,'),(7,1,'','上周六和周本一一直在沟通益康回款的问题，周一周二晚上也一直联系满总，包括透漏回款后的公关费用，周三成功回款。周二到周五一直在公司联系客户，目前东营的企业已经联系完了，烟台的企业联系了一半，可以拜访有需求的企业有两家，看看下周或者节后去拜访。','联系烟台、威海、青岛周边的客户，预计节后一起多拜访几家。','本周没有遇到具体问题，如有问题及时向领导汇报。',11,1567754964,1567757214,',35,1,2,','',',11,1,'),(8,2,'','本周沟通客户如下：\n  一，拜访客户情况：\n      华威得等一两周继续沟通细节；博雅欣和的一致性评价确定放弃啦，考虑网络版验证；新华达得等老板批准；植物的一致性评价审计还在犹豫中；\n二、江西亿友合同情况：确定28,29两天审计客户。费用3.8万，差旅由客户承担。合同在邮寄中\n三、沟通的其他客户情况：\n     A、南阳新生的辅料变更和新增规格得继续保持沟通，\n     B、成都医路康原辅包审计，最后确定自己的朋友来审计。\n     C 、德昌祥的DMS网络版由于汉方集团需要内部重组，暂搁。\n     D、北大医疗的网络版和一致性评价需要后续上门沟通。\n     E、辽宁仙草堂的网络版打算自己做，推荐了备份系统。\n     F、安健药业打算考虑备份系统。\n     G、华森药业的FDA项目，需要做了差距分析了在考虑。\n     H、泰丰药业考虑备份系统。\n     I 、巢湖今辰的质量体系需要等亳州华佗的实施后去考察在决定。\n     J.泰丰的一致性评价现场核查过，单机版考虑备份系统。\n  \n\n     \n      \n','一、对海南三叶、海南日中天、海南天煌的等企业的一致性评价进行对接。\n 二、对云南区域合作的十几家老客户，贵州合作的七八家客户进行备份系统的推荐。\n 三、对岳阳新华达等上周沟通需要反馈的客户进行继续跟进。\n  四、对江西亿友附近的几家一致性评价客户进行对接，争取以点带面。','一、客户需要备份系统的详细介绍资料。',8,1567841111,1567841111,'','',NULL),(9,2,'','周一：贵州济生CSV没有做，有意向请第三方，预计明年三语做；贵州飞云岭对DBS有意向。\n周二：贵州维康子帆对CSV有意向，约上门沟通交流，上门时间没有定；贵州家诚药业企业不具备做CSV的能力，后续继续沟通。深圳赛诺生有意向做实验室和生产上设备的验证，约上门交流沟通，时间定中秋节后，具体时间未定。\n周三：国药血液制品单机版CSV，今年没有计划，需明年报计划，分析意向不强；贵阳润丰只有CSV没有做，有的设备还没有审计追踪功能，后续沟通DMS和DBS；贵州远程制药跟踪检查数据备份有被指出问题，推DBS\n周四：重庆莱美药业岛津网络版CSV做了，注射剂高风险企业，可以沟通上产上设备的验证；上海浦津林州制药单机版CSV做的做的不太完善，推CSV和DBS，注射剂高风险企业还可以推上产设备的验证，后续继续沟通云南特安呐制药单机版CSV企业认为做的较好，03年老设备没有审计追踪功能，推DBS和DMS；云南金碧制药CSV单机版已做完，推DBS，有意向。\n周五：贵州宝芝林单机版CSV厂家做，对DBS意向不强，后续沟通CSV；贵州金宇药业单机版液相一台简单做了CSV，其余设备没有上计算机化系统。\n       本周内还联系了广东客户，单没有意向较强烈的。','9月8-10日参加成都培训班，9月11-13日联系广东客户，争取联系三四家意向客户，随赛诺生一起拜访。','',9,1567852750,1567852750,'','',',9,'),(10,2,'','领导好，本周（09.02-09.06）工作总结内容：\n1、每天打电话联系新老客户，介绍本公司软件产品及服务项目，尤其DBS自动备份系统软件。\n2、学习DMS、DAS软件操作方法（熟练），网上查找资料加强自身业务知识量。\n3、由于之前未参加本公司办公软件培训，导致自己不能及时更新每日沟通情况，出现了一些罚款。经周末竭老师培训后，已基本掌握办公软件。\n4、本周前电话联系的客户情况都已在新建客户的备注里，有所体现。下周以日志汇报每天工作情况。','1、继续打电话联系客户，有需求的建立商机，并在后期跟进。\n2、上周进行的培训，多看多听多查找进行吸收消化。\n3、主推DBS自动备份系统软件，沟通过程中有问题及时联系并反馈。\n4、联系翟老师，查找本公司以前培训的音频资料，进行学习。','1、软件产品及项目知识掌握的不够深。\n2、多参加公司培训，多学习，多沟通。',30,1567954842,1567954842,',35,14,2,1,','',',30,');
